import React, {Fragment} from 'react';
// import image2 from './img/image2.jpg';
import 'react-slideshow-image/dist/styles.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

import Sponsors from '../sponsors/Sponsors';
import Informations_pratiques from '../informations_pratiques/Informations_pratiques';
import Erreur404 from '../error_404/Erreur404';
import Accueil from '../accueil/Accueil';
import Informations from '../informations/Informations';
import Billeterie_page from '../billeterie/Billeterie_page';
import Direct_page from '../direct/Direct_page';
import Contact from '../contact/Contact';
import Programmation from '../programmation/Programmation';
import Map from '../map/Map';


  const Redirection = () => {
    return (
      <Fragment> 
        <Router forceRefresh={true}>
            <Switch>
              <Route path="/build" exact component={Accueil} />
              <Route path="/build/Sponsors"  component={Sponsors} />
              <Route path="/build/build/Informations_pratiques"  component={ Informations_pratiques } />
              <Route path="/build/Informations"  component={ Informations } />
              <Route path="/build/Billeterie_page"  component={ Billeterie_page } />
              <Route path="/build/Direct_page"  component={ Direct_page } />              
              <Route path="/build/Contact"  component={ Contact } />              
              <Route path="/build/Programmation"  component={ Programmation } />    
              <Route path="/build/Map"  component={ Map } />    
              <Route path="/build/"  component={Erreur404} />

          </Switch>
        </Router> 
      </Fragment> 
    ) 
  }


export default Redirection;
